import { useNavigate } from 'react-router-dom';

export default function Splash() {
    const navigate = useNavigate();
    useEffect(() => {
        setTimeout(() => {
            navigate('/home');
        },3000)
    },[])
    return (
        <div className="Splash">
            <div className="title">Webpage Title</div>
            <div className="tagline">Tagline</div>
        </div>
    );
}
